import App from 'next/app'
import '../public/style/pages/comm.css'
import 'antd/dist/antd.css'
import Router from 'next/router'
Router.events.on('routeChangeError', (err, url) => {
  if (err.cancelled) {
    console.log(`asdasdasd`)
  }
})
export default App
